import React from "react";
import { Modal, TextField, Button } from "@mui/material";

const IncomeModal = ({ open, onClose }) => {
  return (
    <Modal
      open={open}
      onClose={onClose}
      sx={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "rgba(239, 239, 239, 0.85)",
      
      }}
    >
      <div
        style={{
          backgroundColor: "#fff",
          padding: "0 0 20px 20px",
          width: "538px",
          height: "164px",
          borderRadius: "20px",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <h3 style={{ fontWeight: "700", fontSize: "30px" , padding:0}}>Add Balance</h3>
        <TextField
          size="small"
          placeholder="Income Amount"
          onChange={(e) => console.log(e.target.value)}
          sx={{
            borderRadius: "10px",
            backgroundColor: "rgba(217, 217, 217, 1)",
            color: "rgba(145, 145, 145, 1)",
            overflow: "hidden",
          }}
        />
        <Button
          variant="contained"
          sx={{
            textTransform: "none",
            fontWeight: "400",
            fontSize: "16px",
            color: "#000",
            backgroundColor: "#fff",
            borderRadius: "10px",
            margin: "0 1rem 0 1rem",
            ":hover" : {
              backgroundColor: "rgba(244, 187, 74, 1)",
              color:"#fff"
            }
          }}
        >
          Add Balance
        </Button>
        <Button
          variant="contained"
          sx={{
            textTransform: "none",
            fontWeight: "400",
            fontSize: "16px",
            color: "#000",
            backgroundColor: "#fff",
            borderRadius: "10px",
            ":hover" : {
                backgroundColor: "rgba(244, 187, 74, 1)",
                color:"#fff"
              }
          }}
          onClick={onClose}
        >
          Cancel
        </Button>
      </div>
    </Modal>
  );
};

const ExpenseModal = () => {
  return <div></div>;
};

export { IncomeModal, ExpenseModal };
